ign:center;'>",Hxd='<gwt:clipper style="',mod='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',yxd="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",$Gd='<p>Imagine the following hypothetical scenario:<\/p><p>There has been an earthquake in the town you live in and many have been injured. All roads to your town have been blocked and as a result aid is coming in very slowly. Because of this every family has to split packages of aid sent using helicopters with another family. You and the family that have to split the aid items with each other, both have babies who have been injured and have developed infections. The only way to control the spread of infection, which if not stopped will become lethal, is to use penicillin. You are also running low on food, but have enough clean water that would last you for several days. All the shops in the town are closed, so it is uncertain whether you can use the money to purchase goods. Given the circumstances, you know that no other aid package will be received for another week. The aid packages include medicine including penicillin, canned food, some money and water bottles.<\/p><p>In the task that follows, you have to negotiate how these items have to be split between your family and the other household. You do not know how much food and water the other family has.<\/p><p>The negotiation is done in a sequence of alternating offers. You will make the first offer. The other negotiator may or may not accept your offer. If it does not accept it, that is, if it rejects your offer, it will send you a new offer. You can either accept or reject its offer. If you accept it, you will get to keep the items that you did not give them. If you reject their offer, you can make another offer and submit it to them. If after 24 rounds there is no agreement, the negotiation will end in \u201Cno agreement.\u201D In this case, you both will only receive one of each item and the rest will be given away.<\/p><p>Try to get as many items as you can. <\/p><p>Here are the icons representing the objects:<\/p><p>Medicine: <img src="http://emotions.usc.edu/group/images/Pills-MD.png" alt="Medicine" width="42" height="42" /><\/p><p>Water Bottles: <img src="http://emotions.usc.edu/group/images/Waterbottle-MD.png" alt="Water Bottles" width="42" height="42" /><\/p><p>Money: <img src="http://emotions.usc.edu/group/images/CashPic-MD.png" alt="Money" width="42" height="42" /><\/p><p>Food Cans: <img src="http://emotions.usc.edu/group/images/can-new.png" alt="Food Cans" width="42" height="42" /><\/p>',ryd='<pre>',Mgd='<span',fld="<span style='color:",LPd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style><ul><li>Behind this window is the trading board where all the items are located. <\/li><\/ul><ul><li>You need to decide how to divide the items between your family and the other family by dragging each item and putting it either on your own side or on the other side. <\/li><\/ul><ul><li>Your side is the bottom section and the upper section belongs to the other family.<\/li><\/ul><ul><li>No item should be left in the middle. You can take all of the items or give then all away, or take some and not others. It is up to you how you want to do it. <\/li><\/ul><ul><li>When you are done with splitting the items, click on "Make Initial Proposal". <\/li><\/ul><ul><li>If you are happy with an offer, click on Accept Proposal. <\/li><\/ul><ul><li>If you want to make a new proposal, redistribute the item and then click on "Make Counterproposal".<\/li><\/ul><\/font>',EPd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style><ul><li>Imagine the following hypothetical scenario:<\/li><\/ul><ul><li> There has been an earthquake in the town you live in and many have been injured. All roads to your town have been blocked and as a result aid is coming in very slowly. Because of this every family has to split packages of aid sent using helicopters with <b>your boss\'s family.<\/b><\/li><\/ul><ul><li>You and the family that have to split the aids with each other, both have babies who have been injured and have developed infections. The only way to control the spread of infection, which if not stopped will become lethal, is to use penicillin. You are also running low on food, but have enough clean water that would last you for several days. You have enough soaps, so you might not need any hand sanitizers.<\/li><\/ul><ul><li>Given the circumstances, you know that no other aid package will be received for another week.<\/li><\/ul><ul><li> In the task, to review, you will negotiate with the other family over the aid packages that include <\/li><table><tr><td width="170px" valign="middle" height="55px"><Label-style>1. Medicine (penicillin):    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/medicine.png" alt="Medicine" width="42" height="42" /><\/td><td width="130px" valign="middle"><Label-style>2. Water bottles:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/water_bottles.png" alt="Water bottles" width="42" height="42" /><\/td><\/tr><tr><td width="170px" valign="middle" height="55px"><Label-style>3. Canned food:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/canned_food.png" alt="Canned food" width="42" height="42" /><\/td><td width="130px" valign="middle"><Label-style>4. Hand sanitizer:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/hand_sanitizer.png" alt="Hand sanitizer" width="42" height="42" /><\/td><\/tr><\/table><\/li><\/ul><ul><li>You have to negotiate how these items have to be split between your family and <b>your boss\'s family<\/b>. You do not know how much food and water the other family has.<\/li><\/ul><ul><li>The negotiation is done in a sequence of alternating offers. You will make the first offer. The other negotiator may or may not accept your offer. If it does not accept it, that is, if it rejects your offer, it will send you a new offer. You can either accept or reject its offer. If you accept it, you will get to keep the items that you did not give them. If you reject their offer, you can make another offer and submit it to them. Both families will have a chance to make <b>6 offers <\/b>in this negotiation.<\/li><\/ul><ul><li>You can express your felt emotions anytime during the game. If you click on one of facial displays, it will be immediately shown to the other participant. Similarly, when the other participant changes his/her facial display, the new face will be shown to you. Five facial displays you can choose include:<\/li><table><tr><td width="170px" valign="middle" height="55px"><Label-style>1. Happy:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/happy.gif" alt="Happy" height="50" /><\/td><td width="130px" valign="middle"><Label-style>2. Content:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/content.gif" alt="Happy" height="50" /><\/td><td width="170px" valign="middle" height="55px"><Label-style>3. Neutral:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/neutral.gif" alt="Neutral" height="50" /><\/td><\/tr><tr><td width="130px" valign="middle"><Label-style>4. Angry:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/angry.gif" alt="Angry" height="50" /><\/td><td width="130px" valign="middle"><Label-style>5. Sad:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/sad.gif" alt="Sad" height="50" /><\/td><\/tr><\/table><\/ul><\/Label-style>  ',FPd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style
